note_models.css:
@font-face {
   font-family: 'IPAGothic';
   font-style: normal;
   font-weight: 400;
   src: url(_ipag.ttf) format('truetype');
 }
:root{
	--highlight: #5E81AC;
	--least-important:#4C566A;
	--highlight2: #BF616A;
	--slight_highlight: #434C5E;
	--default: #2E3440;
	--hint: #5E81AC;
	--dark_hint:#B48EAD;
	--dark_default:#E5E9F0;
	--dark_highlight:#5E81AC;
	--dark_slight_highlight: #88C0D0;
}
body {
margin: 0;
}
.dotted_front{
	border-bottom-width: 5px;
	border-bottom-style: dotted;
	border-bottom-color: var(--dark_slight_highlight);
}
.dotted_back{
	border-bottom-color:var(--dark_slight_highlight);
	border-bottom-width: 3px;
	border-bottom-style: dotted;
}
.container {
display: flex;
flex-direction: column;
height: 100vh;
justify-content: center;
align-items: stretch;
}
.card-content {
flex: 1;
padding: 20px;
padding-top:0;
}
.footer {
	padding: 20px;
	padding-bottom: 5px;
	padding-top:0px;
}
.card {
	margin-top: 0px;
	height: 100%;
	font-family:  Helvetica, "IPAGothic", Arial,Verdana,sans-serif;
}
.parent {
  white-space: nowrap;
  padding-top: 30vh;
}
#Komposita{
	margin-top:30vh;
	font-size: 120px;
   	font-family: IPAGothic;
	color: var(--highlight);
	height:120px;
}
.nightMode #Komposita{
	color: var(--dark_highlight);
}
.KanjiHighlight{
	text-decoration:underline;
	color:var(--dark_slight_highlight);
}

#no {
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
}
.nightMode #no {
	color:var(--least-important);
}
.KompositaBack{
	font-family: Helvetica, IPAGothic;
	color: var(--slight_highlight);
	font-size: 40px;
	padding-top: 5vh;
	padding-left: 10px;
	font-style: normal;
}
.nightMode .KompositaBack{
	color:var(--dark_slight_highlight);
}
.ReadingBack{
	margin-top:5vh;
	text-align:center;
	font-size: 70px;
   	font-family: IPAGothic;
	color: var(--highlight);
}
.nightMode .ReadingBack{
	color: var(--dark_highlight);
}
.card .KanaBack{
	font-family: Helvetica, IPAGothic;
	color: var(--least-important);
	font-size: 40px;
	padding-left: 10px;
	font-style: normal;
}
.MeaningBack{
hyphens:auto;
	padding-left: 10px;
    min-height:15vh;
	text-align: center;
	font-size: 25px;
	text-align:left;
	color:var(--default);
}
.nightMode .MeaningBack{
	color:var(--dark_default);
}

.KompositaKanaFront{
	margin-top:30vh;
	font-size: 100px;
   	font-family: IPAGothic;
	color: var(--highlight);
	height:120px;
}
.darkMode .KompositaKanaFront{
	color: var(--dark_highlight);
}
.MeaningFrontContainer{
	display: flex;
	flex-direction: column;
	height: 90vh;
	width:90vw;
}
.MeaningFront{
	margin-top: auto;
 	font-family: Helvetica;
	font-size: 40px;
	color: var(--highlight);
	text-align:left;
	hyphens: auto;
	justify-content: flex-end;
}
.nightMode .MeaningFront{
	color: var(--dark_highlight);
}
.KanjiHint{
	font-family: Helvetica, IPAGothic;
	color: var(--slight_highlight);
	font-size: 50px;
	padding-left: 30px;
	font-style: normal;
	margin-bottom:auto;
}
.nightMode .KanjiHint{
	color: var(--dark_slight_highlight);
}
.card .TonBack{
	display:none;
}

/* ANDROID SETTINGS */
.android .container {
	height: 97vh; /*AnkiDroid seems to calculate vh with area below buttons*/
}
.android.card .nightMode {
	background-color:#000000;
}
